LL,0,1.00,'2024-10-28 14:41:26','2024-10-28 14:41:26'),(1180,'Funkcionális Specifikáció - 2. Vágyálomrendszer leírása - KGZS',NULL,NULL,98,251,NULL,NULL,NULL,0,1.00,'2024-10-29 16:10:10','2024-11-06 14:05:16'),(1181,'Funkcionális Specifikáció - 3. Jelenlegi üzleti folyamatok modellje - KGZS',NULL,NULL,98,251,NULL,NULL,NULL,0,1.00,'2024-10-29 16:31:30','2024-11-06 14:05:17'),(1182,'Funkcionális Specifikáció - 1. Jelenlegi helyzet leírása - KGZS',NULL,NULL,98,251,NULL,NULL,NULL,0,1.00,'2024-10-29 16:47:27','2024-11-06 14:05:15'),(1183,'Funkcionális Specifikáció',NULL,NULL,98,245,NULL,NULL,NULL,0,2.00,'2024-10-29 16:59:41','2024-10-29 17:00:14'),(1184,'Követelmény Specifikáció - 1. Jelenlegi helyzet leírása - KGZS',NULL,NULL,98,251,NULL,NULL,NULL,0,1.00,'2024-10-29 17:00:46','2024-11-06 14:05:15'),(1185,'Readme megírása a Github-on - KGZS',NULL,NULL,98,251,NULL,NULL,NULL,0,1.00,'2024-10-29 17:11:14','2024-11-06 14:04:52'),(1186,'Funkcionális Specifikáció - 5. Követelménylista - KGZS',NULL,NULL,98,251,NULL,NULL,NULL,0,1.00,'2024-10-29 17:20:17','2024-11-06 14:05:19'),(1188,'2. Projektterv','1. Projekt célja\nA projekt célja egy Laravel alapú pizzarendelő weboldal fejlesztése, amely támogatja az online rendelést, a kosár kezelést, és az adminisztrációs funkciókat.\n\n2. Ütemterv (6 hét)\n1. hét – Tervezés\n* Követelmények felmérése: A rendszer szükséges funkcióinak meghatározása.\n* Felhasználói felület tervezése: Böngészőalapú, mobil- és asztali eszközökre optimalizált felület tervezése.\n* Adatbázis struktúra megtervezése: Termékek, kosár, rendelések és felhasználói adatok tárolása.\n2-4. hét – Fejlesztés\n* Pizzák megjelenítése: Menüoldal kialakítása kategóriákkal és szűrőkkel.\n* Kosár funkciók implementálása: Kosár frissítése, mennyiségek kezelése.\n* Rendelés kezelés: Rendelés felvételi és szállítási folyamat kidolgozása.\n5-6. hét – Tesztelés és telepítés\n* Tesztelés: Funkcionális tesztelés és hibajavítás.\n* Telepítés és karbantartási terv készítése: Stabil verzió feltöltése a szerverre, telepítési útmutató.\n3. Fő funkciók\n* Pizzák böngészése és részletezés: Különféle pizzák listázása és részletek megjelenítése.\n* Kosár kezelés: A kosárba helyezett pizzák, mennyiség és ár követése.\n* Rendelés leadása és fizetés: Online rendelés létrehozása és visszaigazolás.\n* Adminisztrációs panel: Termékek szerkesztése és rendeléskezelés.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:27:40','2024-11-02 15:36:04'),(1189,'3. Üzleti folyamatok modellje','1. Felhasználói folyamatok\nPizzák böngészése\n* Bemenet: Felhasználó böngészi a kínálatot, és megnyit egy pizza részleteit.\n* Kimenet: A pizza részletező oldalon információkat kap, például összetevőket, árat és méretválasztékot.\nKosár kezelése\n* Bemenet: A felhasználó kiválasztja a kívánt pizzát és hozzáadja a kosárhoz.\n* Kimenet: A kosárban megjelenik a kiválasztott termék, melyet további termékekkel egészíthet ki, vagy módosíthat.\nRendelés leadása\n* Bemenet: Felhasználó kitölti a rendelési adatokat, majd véglegesíti a rendelést.\n* Kimenet: A rendszer visszaigazolást küld, és az adminisztrátori felületen megjelenik az új rendelés.\nAdminisztráció\n* Bemenet: Adminisztrátor bejelentkezik, termékeket kezel vagy rendeléseket ellenőriz.\n* Kimenet: Frissített pizzák vagy teljesített rendelés státusz.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:27:52','2024-11-02 15:36:05'),(1190,'4. Követelmények','Funkcionális követelmények\n1. Pizzák megjelenítése a főoldalon.\n2. Különféle szűrési és rendezési opciók biztosítása.\n3. Kosár hozzáadás, eltávolítás, mennyiségváltoztatás.\n4. Felhasználók regisztrációja, bejelentkezése.\n5. Fizetési módok kezelése.\n\nNemfunkcionális követelmények\n1. Gyors oldalbetöltési idő.\n2. Reszponzív felhasználói felület.\n3. Biztonságos adatkezelés.\n4. Stabil működés nagyobb forgalom mellett.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:27:58','2024-11-01 15:32:49'),(1191,'5. Technológiai követelmények','Backend: Laravel keretrendszer\nFrontend: HTML, CSS, JavaScript (Vue.js vagy React)\nAdatbázis: MySQL\nWebszerver: Apache vagy Nginx',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:28:03','2024-11-01 16:32:49'),(1192,'6. Fizikai környezet','Szerver: Linux alapú VPS vagy felhőalapú szolgáltatás\nSávszélesség: Minimum 100 Mbps\nBiztonsági követelmények: HTTPS, SSL tanúsítvány',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:28:08','2024-11-01 16:32:50'),(1193,'7. Tesztterv','Tesztesetek\nTeszteset	Elvárt eredmény\nPizzák listázása	Minden pizza megjelenik\nKosárba helyezés	Kosár tartalma frissül\nRendelés leadása	Rendelés visszaigazolása sikeres\nAdmin termékkezelés	Termékek módosítása sikeres',NULL,95,236,NULL,NULL,NULL,0,23.44,'2024-10-29 17:28:16','2024-10-30 21:34:40'),(1194,'8. Telepítési terv','1. Adatbázis létrehozása: MySQL szerver telepítése és adatbázis struktúra beállítása.\n2. Laravel környezet beállítása: Composer és Laravel telepítése a szerverre.\n3. Rendszer konfigurációk: .env fájl beállítása az adatbázis elérési adatokkal.',NULL,95,236,NULL,NULL,NULL,0,23.47,'2024-10-29 17:29:00','2024-10-30 21:34:43'),(1195,'9. Karbantartási terv','1. Adatbázis mentés: Napi biztonsági mentések.\n2. Rendszer frissítések: Laravel és csomagok frissítése.\n3. Hibajavítás: Tesztelés és javítás felhasználói visszajelzések alapján.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:29:06','2024-11-02 15:36:26'),(1196,'1. A rendszer célja','A pizzarendelő weboldal célja, hogy a felhasználók egyszerűen rendeljenek pizzát online, áttekintsék a kínálatot, kosárba helyezzék a kívánt termékeket, majd véglegesítsék a rendelést. Az oldal Laravel keretrendszerrel készül, biztosítva a biztonságos adatkezelést, a felhasználóbarát felületet és a gyors működést.\n\nFő célok:\n1. Pizzák megjelenítése: A felhasználók böngészhetik az elérhető pizzák listáját különböző szűrők és kategóriák alapján.\n2. Kosár funkció: A látogatók kosárba helyezhetik a pizzákat és egyéb termékeket, nyomon követhetik azok mennyiségét és árát.\n3. Rendelés leadása: A kosár tartalma alapján a felhasználók leadhatják rendelésüket, megadva szállítási adatokat.\n4. Adminisztráció: Az adminisztrátorok kezelhetik a termékkínálatot, nyomon követhetik a rendeléseket, és frissíthetik az elérhető pizzák adatait.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:29:48','2024-11-01 16:32:48'),(1198,'RENDSZERTERV',NULL,NULL,95,236,NULL,1,NULL,0,15.56,'2024-10-29 17:43:33','2024-11-01 16:32:47'),(1199,'10. Projektszerepkörök és felelőségek','Scrum Master: Sinka Barnabás\nProduct Owner: Győrfi Bence, Sálek Dániel, Szilágyi Kristóf, Márton Gergely, Bukovinszki Bálint\nÜzleti szereplő: Sinka Barnabás',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:55:11','2024-11-01 16:32:52'),(1200,'11. Fizikai alrendszerek','A rendszer komponensei:\n\nWebszerver: Linux alapú VPS, amely támogatja a Laravel-t és a PHP-t.\n* Adatbázis-szerver: MySQL adatbázis a megrendelések, felhasználói és termékadatok kezelésére.\n* Tűzfal és SSL tanúsítvány: A biztonságos adatkezelés érdekében.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:55:26','2024-11-02 15:36:15'),(1201,'12. Vásárolt szoftverkomponensek és külső rendszerek','* Laravel csomagok: Autentikációs és jogosultságkezelés, Stripe fizetési modul.\n* Fizetési szolgáltatás: Integráció Stripe rendszerrel az online fizetésekhez.\n* Hosting szolgáltatás: VPS vagy felhőalapú tárhely (pl. DigitalOcean, AWS).',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:55:34','2024-11-01 16:32:52'),(1202,'13. Üzleti szereplők','Felhasználók: Akik a pizzarendelő oldalon rendeléseket adnak le.\nAdminisztrátorok: Akik felügyelik az oldal működését, kezelik a rendeléseket, és frissítik a kínálatot.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:55:44','2024-11-01 16:32:53'),(1203,'14. Mérföldkövek','1. Dokumentáció elkészítése\n2. Funkciók kidolgozása\n3. Prototípus készítése\n4. Kész program publikálása',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:55:54','2024-11-01 16:32:54'),(1204,'15. Adatbázis terv','Táblák:\n* Pizzák (Pizzas): A pizzák neve, leírása, ára, és elérhető méretek.\n* Felhasználók (Users): A regisztrált felhasználók adatai.\n* Rendelések (Orders): A leadott rendelések adatai, státusza és időbélyege.\n* Kosár tételek (CartItems): A kosárban található tételek a rendelés véglegesítéséig.\nTáblakapcsolatok\n* Rendelések és Felhasználók között: 1\nkapcsolat.\n* Rendelések és Kosár tételek között: 1\nkapcsolat.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:56:01','2024-11-02 15:36:17'),(1205,'16. Funkcionális követelmények','1. Pizzák megjelenítése a főoldalon és kategóriák szerint.\n2. Kosárkezelés: Termékek hozzáadása, eltávolítása, mennyiségváltoztatás.\n3. Rendelés leadása és visszaigazolás küldése.\n4. Felhasználói regisztráció és bejelentkezés.\n5. Adminisztrációs funkciók: Termékek és rendeléskezelés.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:56:10','2024-11-02 15:36:18'),(1207,'17. Nemfunkcionális követelmények','1. Gyors oldalbetöltési idő, különösen mobil eszközön.\n2. Reszponzív felhasználói felület, amely különféle eszközökön jól működik.\n3. Biztonságos adatkezelés, beleértve az SSL titkosítást és jelszavas védelmet.\n4. Stabil működés nagyobb felhasználói forgalom mellett.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:57:27','2024-11-02 15:36:18'),(1208,'18. Funkcionális terv','Feladatkezelés\nPizza hozzáadása: Új pizza létrehozása névvel, leírással, árral.\nPizza módosítása: Meglévő pizzák szerkesztése az admin panelen.\nPizza törlése: Nem elérhető pizzák eltávolítása.\nKosárkezelés\nTermékek hozzáadása a kosárhoz: Termék kiválasztása és kosárba helyezése.\nKosár tartalmának megjelenítése: A felhasználó által kiválasztott termékek.\nRendelés kezelése\nRendelés leadása: Felhasználó rendelésének elküldése.\nRendelési állapot frissítése: Adminisztrátor frissítheti a rendelés státuszát.\nFelhasználói felület (UI)\nIntuitív és könnyen navigálható felület, különféle gombok és listák segítségével.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:57:47','2024-11-02 15:36:19'),(1209,'19. Rendszerszereplők','Felhasználó: Az oldal használója, aki rendeléseket ad le.\nRendszer: A rendeléseket kezeli, a felhasználói interakciókat feldolgozza.\nAdatbázis/fájlrendszer: A pizzák, felhasználói adatok és rendelések tárolásáért felel.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:57:57','2024-11-02 15:36:20'),(1210,'20. Menühierarchiák','Főmenü\nFőoldal: Kínálat áttekintése.\nKosár: Kosár tartalmának megtekintése és rendelés folytatása.\nProfil: Regisztráció és bejelentkezés, valamint rendelés előzmények megtekintése.\nAdmin panel: Adminisztrációs felület a termékek és rendelések kezeléséhez (csak adminisztrátorok számára).',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:58:04','2024-11-02 15:36:20'),(1211,'21. Hardver topológia','Internet  \nRouter → Szerver (Linux alapú) → Felhasználói eszközök (PC, mobiltelefon, tablet)\nVPS tárhely vagy felhőalapú infrastruktúra (pl. DigitalOcean, AWS) biztosítja a megfelelő hozzáférést és adatkezelést.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:58:11','2024-11-01 16:32:56'),(1212,'22. Fejlesztő eszközök','Visual Studio Code: Laravel projektek fejlesztése.\nGitHub/GitLab: Verziókövetés.\nPHP 8+ és Composer: Laravel keretrendszer futtatása és kezelés.\nMySQL Workbench: Adatbázis tervezés és kezelés.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:58:39','2024-11-01 16:32:57'),(1213,'23. Architekturális terv','Architekturális rétegek\nFelhasználói felület (UI) réteg\n\nLeírás: Az oldalon található interakciós elemek, pl. kosár és rendelés menü kezelése.\nTechnológiák: HTML, CSS, JavaScript, Vue.js vagy React.\nÜzleti logika réteg\n\nLeírás: A rendeléskezelési és kosárkezelési funkciók üzleti logikája.\nTechnológiák: PHP Laravel.\nAdatkezelési réteg\n\nLeírás: Felhasználói adatok, termékek és rendelésadatok tárolása.\nTechnológiák: MySQL.\nAdatmodell\nPizza: Pizza adatai, pl. név, leírás, ár.\nFelhasználó: Regisztrált felhasználók adatai, pl. név, e-mail cím, jelszó.\nRendelés: Rendelés részletei, pl. tételek, időpont, státusz.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:58:48','2024-11-01 16:32:57'),(1214,'24. Adatbázis rendszer','Adatbázis struktúra\nPizzák tábla: Pizzák és hozzájuk tartozó adatok tárolása.\nFelhasználók tábla: Felhasználói adatok és kapcsolódó információk.\nRendelések tábla: Leadott rendelések és státuszaik tárolása.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:58:59','2024-11-02 15:36:20'),(1215,'25. Implementációs terv','Adatbázis beállítása: MySQL adatbázis struktúra létrehozása.\nLaravel környezet telepítése és konfigurálása: Projekt alap beállítása.\nFunkciók fejlesztése: Pizzák megjelenítése, kosár funkciók és rendeléskezelés.\nTesztelés: Egység- és funkcionális tesztek elvégzése.\nTelepítés: Szerverre történő telepítés és élesítés.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:59:08','2024-11-02 15:36:21'),(1216,'26. Támogatott eszközök','Webböngészők: Chrome, Firefox, Safari, Edge.\nOperációs rendszerek: Windows, macOS, Linux, iOS, Android.',NULL,95,238,NULL,NULL,NULL,1,1.00,'2024-10-29 17:59:18','2024-11-02 15:36:24'),(1219,'Admin panel (Felhasználó rész)',NULL,NULL,104,279,NULL,NULL,NULL,0,4.00,'2024-10-29 20:12:27','2024-11-10 00:42:51'),(1220,'Navigációs bár',NULL,NULL,104,279,NULL,NULL,1219,0,NULL,'2024-10-29 20:14:48','2024-10-29 20:15:56'),(1221,'Adatbázisból lekért adatok dizájnjai(kártyák)',NULL,NULL,104,279,NULL,NULL,1219,0,NULL,'2024-10-29 20:17:15','2024-10-29 20:18:32'),(1222,'Admin részleg design',NULL,NULL,104,279,NULL,NULL,1219,0,NULL,'2024-10-29 20:18:52','2024-10-29 20:21:03'),(1223,'Admin panel (Éttermek rész)',NULL,NULL,104,279,NULL,NULL,NULL,0,6.00,'2024-10-29 20:22:54','2024-10-29 20:22:54'),(1224,'Navigációs bár felépitse',NULL,NULL,104,279,NULL,NULL,1223,0,NULL,'2024-10-29 20:23:34','2024-10-29 20:23:53'),(1225,'Étterem feltöltő panel',NULL,NULL,104,279,NULL,NULL,1223,0,NULL,'2024-10-29 20:24:14','2024-10-29 20:24:25'),(1226,'Éttermek törlése 